    apiKey: "AIzaSyAsC4_WP_tfBFcGqXFUB4HSAZWn9RLXNVw",
    authDomain: "mytube-app-cbe9c.firebaseapp.com",
    databaseURL: "https://mytube-app-cbe9c.firebaseio.com",
})

const base=Rebase.createClass(firebase.database())

